import React from "react";


function App(){
  return(
    <>
      <div className="bg-white w-1/2  flex flex-col">
        <div className="text-center my-[10px]"><h1 className="font-extrabold font-mono text-3xl text-sky-900 ">TODO LIST</h1></div>
        <div className="flex px-[20px] justify-between my-[20px]">
          <input placeholder="Add Your New Todo" className="px-[5px] flex-[0.90] border border-gray-400"></input>
          <div className="flex-[0.05] bg-purple-600 text-center rounded p-[6px] ">
            <h1 className="">+</h1>
          </div>
        </div>
      </div>
      
    </>
  )
}

export default App;
